import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./Login";
import StudentHome from "./StudentHome"; // Trang của học viên
import TeacherHome from "./TeacherHome"; // Trang của giáo viên
import ManagerHome from "./ManagerHome"; // Trang của quản lý
import AdminHome from "./AdminHome"; // Trang của admin

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/student-home" element={<StudentHome />} />
        <Route path="/teacher-home" element={<TeacherHome />} />
        <Route path="/manager-home" element={<ManagerHome />} />
        <Route path="/admin-home" element={<AdminHome />} />
      </Routes>
    </Router>
  );
}

export default App;
